/**
 * 获取url前缀
 * @example /api/aa  => api
 */
export declare function getUrlPrefix(url: string): string;
/**
 * 获取url的域名端口
 * @example /api/aa  => localhost
 */
export declare function getDomain(url: string): string;
/**
 * 获取完整url
 * @example /api/aa  => http://localhost/api/aa
 */
export declare function getFullUrl(url: string): string;
